import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 345,
        background: '#00A1019',
        color: '#ffffff',
        borderRadius:'15%',
        border: 2,
        borderColor: 'red'
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
